class Solution {
public:
    int maxOperations(string s) {
        long long sum=0;
        int num=0;
        for (int i=0;i<s.size();i++){
            if (s[i]=='1') num++;
            else {
                if (i>=1&&s[i-1]=='1')
                    sum+=num;
            }
        }
        return sum;
    }
};
